import React from "react";
import { Button, Form, FormGroup, Label, Input, Modal } from "reactstrap";

class AddSneaker extends React.Component {
  render() {
  return(
    <Modal.Dialog>
      <Modal.Header closeButton>
        <Modal.Title>Add A Sneaker</Modal.Title>
      </Modal.Header>

      <Modal.Body>
          <Form onSubmit={e => this.props.addSneaker(e)}>
            <FormGroup>
              <Label for="Brand">Username</Label>
              <Input
                type="brand"
                name="brand"
                id="brand"
                value={this.props.brand}
                onChange={this.props.handleBrandChange}
                placeholder="brand"
              />
            </FormGroup>
          </Form>
      </Modal.Body>

      <Modal.Footer>
        <Button variant="secondary">Close</Button>
        <Button variant="primary">Save changes</Button>
      </Modal.Footer>
    </Modal.Dialog>
)}}

export default AddSneaker;
